import '../CSSContents/AboutUs.css'
function AboutUs() {
    return (
        <div className="Aboutus-background">
            <div className='AboutUs-pic' >
                <img className='fade-img'
                    src='images/About-us.png' height={200} width={400}
                />
            </div>

            Hello there


        </div>
    )
}

export default AboutUs;
